const SWAPI_ROOT = 'https://swapi.dev/api/';
const SWAPI_PEOPLE = 'people';

export const getApiResources = async (url) => {
    const res =  fetch(url);
    const body =  res.json();

    console.log(res, body);
}

getApiResources(SWAPI_ROOT+SWAPI_PEOPLE);
